   const { isAuthenticated } = store.getState().auth;
   console.log(isAuthenticated);
   let myClass = 'GuestLogoBox';
   if(isAuthenticated === true) {
      myClasses = 'AuthLogoBox'
   }
   /*const onClickLogoHandler = (e) => {
